import React from 'react';
import { Link } from 'react-router-dom';

const Sidebar = () => {
  return (
    <aside className="bg-white-200 w-64 p-4">
      <nav>
        <ul>
          <li>
            <Link to="/" className="block py-2 px-4 hover:bg-gray-300">Overview</Link>
          </li>
          <li>
            <Link to="/page1" className="block py-2 px-4 hover:bg-gray-300">People Directory</Link>
          </li>
        </ul>
      </nav>
    </aside>
  );
};

export default Sidebar;
